window.bookSummaryJSON = "<p>I’m a DIY wizard with magic powers, but that doesn’t stop demons from trying to kill me.</p> <p>Once a successful realtor, I gave up the corporate life to pursue my passion: spending time with my ragtag family and repairing my mansion.</p> <p>I’ve got my work cut out for me. The sweet nymph needs me to winter-proof the garden, the boisterous dullahan needs a new stable, and our goth demon roomie needs a place to work on her projects.</p> <p>And to reward my hard work, the hearth goddess has continued to bless me with strength and magic. I can manipulate plants and reap souls, which is pretty cool.</p> <p>Life is good.</p> <p>So, naturally, demon knights are descending on the neighborhood.</p> <p>Remember when a leaky pipe was the worst of my worries?</p>"; 
